var tipuesearch = {"pages": [{'title': '第一頁', 'text': 'content 1 \n \n \n 按一下 \n \n \n', 'tags': '', 'url': '第一頁.html'}, {'title': '期中報告', 'text': '\n', 'tags': '', 'url': '期中報告.html'}, {'title': '小遊戲', 'text': " Your browser doesn't support the HTML5 element canvas.      Throw dice  \n Stage:   Point:   Outcome:  </form \n", 'tags': '', 'url': '小遊戲.html'}, {'title': '期末報告', 'text': '', 'tags': '', 'url': '期末報告.html'}, {'title': '近端配置與管理', 'text': 'windows network setting \n chrome proxy \n \n \n firefox proxy \n mde.tw \n github.com \n portable programming system \n portablegit - remove helper = manager \n login github add repository - README.md \n git clone\xa0 self-repo and CMSimfly \n y:\\home\\.gitconfig \n git config --global user.name "50733129" git config --global user.email "50733129@gm.nfu.edu.tw" git config --global http.proxy \xa0 http://:140.130.17.4:3128 \n git add . \n git commit -m "commit description" \n git push \n Github Pages - setting, url \n local python wsgi.py \n ssh vs https (y:\\home\\.ssh\\config) \n .git/config (url = \xa0 git@github.com:50733129/2019wcmj.git ) \n Roc flag \n  導入 Brython 標準程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n \n', 'tags': '', 'url': '近端配置與管理.html'}, {'title': '學習心得', 'text': '學號:50733129 姓名:彭彥華 \n 心得: \n 剛開始聽到這門課時，那時以為會很輕鬆，但在開始上課之後，覺得這真的很麻煩，起出做的時候都還跟的上，但到了第四週，建立自己的倉儲跟網站，慢慢開始卡關，原本晚上都不用來用的，但現在幾乎每個禮拜都要來，但每次只要有出問題，後面弄懂並修改完成，就會很有成就感，雖然還是有些弄不懂的。 \n', 'tags': '', 'url': '學習心得.html'}, {'title': '網路連線設定', 'text': '了解機械設計系電腦輔助設計室電腦的網路設定, 其中包括 IPv4 網路與 IPv6 網路設定. 正常情況下, 電腦輔助設計室中的 64 台電腦透過 IPv4 協定下的 DHCP 與 NAT 上網, 各電腦以 DHCP client 取得 192.168.1.* 的網路位址, 然後以 NAT 的一組外部 IP 上網, 通常必須設定 Proxy Server 為 http://proxy.kmol.info:3128 後上網會比較順暢, 但若 8 台 Proxy Servers 無法正常運作時, 則取消 Proxy Server 的設定. 瀏覽器代理主機設定 了解如何設定 Google Chrome 與 Firefox 瀏覽器的代理主機設定. 申請 Github 帳號 利用 Gmail 帳號申請 Github 帳號, 申請後利用電子郵箱收信進行確認後, 就可以在 Github 上建立倉儲.', 'tags': '', 'url': '網路連線設定.html'}, {'title': '配置可攜程式環境', 'text': '取得 Windows 10 64 位元環境下的可攜程式環境 (下載 2019_cdb_w5.7z), 下載後解開目錄, 放入 USB3.0 規格以上的隨身碟或隨身硬碟. 以滑鼠點擊 start.bat 開啟可攜隨身系統, 以 stop.bat 關閉可攜隨身系統, 隨身碟必須在關閉所有應用程式執行下, 才可正常退出. 了解基本的 DOS (Disk Operating System) 指令 C:\\> 符號為 DOS 命令列視窗的回應 (Prompt), 表示目前在 C 槽硬碟的 \\ 根目錄, 若要切換到 Y 槽, 則在電腦的回應後, 輸入 Y:, 命令列將轉為 Y:\\> 若要更換目錄, 則使用 cd, 也就是 change directory 的意思, 例如: Y:\\>cd tmp 表示要從 Y 槽的根目錄更換到 tmp 目錄, 也就是 Y:\\tmp> 若要再回到 Y 槽的根目錄, 可以使用 cd .. 表示要從目前所在目錄, 往上跳回一個目錄, 也就是重新回到 Y 槽的根目錄. 另外, 無論目前位於哪一個子目錄, 也可以使用 cd \\ 直接回到根目錄. 或者從 Y:\\> 直接使用 cd \\tmp\\repo\\ssh\\wcm2019 直接從 Y 槽的根目錄, 跳進 Y:\\tmp\\repo\\ssh\\wcm2019> 此外, 常用的 DOS 指令有: dir - 列出目前所在目錄的內容 mkdir - 隨後加上要建立目錄的名稱, 可以建立目錄 cls - clear screen, 清除目前的命令列顯示的內容', 'tags': '', 'url': '配置可攜程式環境.html'}, {'title': '倉儲改版', 'text': '建立 Git 倉儲, 並 clone 倉儲至近端工作後, 對遠端倉儲改版 可攜程式系統中已經內建 git, 可以在啟動 start.bat 後, 透過 path 的設定, 直接執行 git 指令. 建立 Git 倉儲, 共分為兩類, 一類是直接在 Github 網際介面下建立倉儲時, 要求建立 README.md 檔案, 之後可以直接在近端, 以 git clone 加上倉儲連線 URL, 將倉儲克隆一份到近端, 並以最新版本作為工作目錄, 使用者改版後, 可以直接透過 git add, commit 與 push 對遠端倉儲改版. 另一類則是故意在 Github 網際介面下建立倉儲時, 不要建立任何檔案, 而是在近端自行利用 git 指令建立倉儲架構, 新增內容後, 以 git remote add 設法在近端倉儲中納入 origin URL 後, 將近端倉儲版本新增提交推送到遠端. git add git add 可以用來新增一個檔案, 數個檔案, 或在之前提交後所新增的所有內容. git add 在 GIT 架構下, 是對所新增或修改的內容拍快照: git add . adds all modified and new (untracked) files in the current directory and all subdirectories to the staging area (a.k.a. the index), thus preparing them to be included in the next git commit . Any files matching the patterns in the .gitignore file will be ignored by git add git commit git commit 執行之前, 必須使用 git config 建立臨時或永久的身分註記, 因為 GIT 在展開所有改版內容時, 必須明確登錄這些變更的作者與時間. 當使用者採用 git commit -m "改版說明訊息", 此次提交到 .git 目錄下的更動內容, 均會綁定使用者身分與改版所輸入的說明訊息. git push git push 在隨後沒有輸入遠端 URL 代號時, 表示要推送到 origin, 若透過 git remote add 設定其他代號與 URL 對應時, git push 加上代號, 就可以將此次的提交內容, 推送到指定的 URL 所在遠端倉儲. 靜態 CMSimfly 利用 CMSimfly (https://github.com/chiamingyen/cmsimfly) 內容, 建立自己的 Github Pages 網站 設法利用 HTML5 CSS 與 Javascript, 納入與機械設計相關的靜態網頁內容', 'tags': '', 'url': '倉儲改版.html'}, {'title': '國旗', 'text': '\n  啟動 Brython  \n \n \n \n  導入 Brython 標準程式庫  \n \n \n \n  啟動 Brython  \n \n \n \n \n', 'tags': '', 'url': '國旗.html'}, {'title': '虎科大vpn', 'text': '1.首次使用須先安裝SSL VPN 程式(Juniper Networks Connect)\xa0 \n (1)請依您的作業系統版本下載使用者端程式： 連結 \xa0 \n \xa0 (2)程式下載完成後，點擊兩下開始安裝。 \n \n 2.\xa0 進行身份驗證(可由Juniper Network Connect或IE，請擇一進行身分認證) \n \n 2-1:\xa0Juniper\xa0Network Connect 應用程式認證 \n \n \n \n 1."點選搜尋" > 輸入程式名稱為Network Connect> 點擊Network Connect \n \n \n 2.執行程式後，於"登入頁面"輸入網址 :\xa0 https://sslvpn9.twaren.net/nfu \xa0 ，後按下"執行" \n \n 3.輸入使用者帳號密碼，請填入校務行政AD帳號及密碼。請完整填寫您在校務行政AD帳號以及密碼，否則國網中心找不到對象進行身份確認\xa0 ！(例: 員工編號或學號@ctx10.nfu.edu.tw） \n \n 4.出現"設定控制-警告"視窗，按下"是 \n \n \xa05.螢幕右下角顯示"已連接"，表示已成功連線。 \n \n 2-2: IE網認證 \n \n 1.請在IE瀏覽器上按下右鍵 使用"以系統管理員身分執行" \n 登入頁面請輸入：\xa0 https://sslvpn9.twaren.net/nfu ，按下「執行」，會出現帳號與密碼登入欄位。 請填入虎尾科技大學的校務行政AD帳號及密碼，並請輸入下方驗證碼，進行身份確認。 請完整填寫您在虎尾科技大學的校務行政AD帳號以及密碼 ，否則國網中心找不到對象進行身份確認！ \n (例: \xa0員工編號或學號@ctx10.nfu.edu.tw ） 填寫完畢以後按下Login登入就會開始進行身份確認，請稍後一段時間。 \n \n \n 2.點選「開始」\xa0 \n \n 3.點選「是」，SSL VPN程式安裝完畢後，就會開始跟你的電腦建立連線，請稍後一段時間。 \n \n \n \n 5.\xa0 VPN 連線建立完成 \n \n 連線建立完成後，在電腦的工作列上(桌面右下角)，會出現 Juniper Network Connect VPN Client的圖示，表示VPN連線已經成功的建立在你的電腦上了。點擊圖示兩下，即可查看連線資訊。 (註:指派IP:一定為120.113.100.XX) 。 到此，您的SSL-VPN連線已經成功的建立，不管是在家裡還是出差，您的電腦就像在學校使用一般，您可以自由的使用虎尾科技大學自己擁有的網路資源。 \n \n \n', 'tags': '', 'url': '虎科大vpn.html'}, {'title': 'virtualBox', 'text': '2019/5/28 \n 安裝最新版的virtualBox \n \n 建立 Ubuntu 18.04 虛擬主機，並完成設定 \n \n 大小需移動到 4096 MB \n \n 選擇創造一個新的 \n \n 選擇最上面的選項 \n \n ub的大小拖拉至 500.00GB 大(自行拉到500GB) \n \n 選擇的檔案為 之前已存到隨身碟的ubuntu18.04檔案 \n \n \n 以網路卡橋接啟動 Ubuntu 伺服器 \n \n 以 sudo apt install nginx 安裝 nginx WWW 伺服器 \n \n 以 ifconfig 查 Ubuntu 伺服器的 IP, 測試 nginx 伺服器是否可以連線 \n \n 以 Windows 10\xa0 下的 Filezilla client, 將編輯好的 nginx 設定檔案送到 Ubuntu \n \n 利用 Ubuntu 指令將設定檔案搬至設定位置後, 以 /etc/init.d/nginx restart 重新啟動 nginx 在 Ubuntu 中以 sudo apt install uwsgi 安裝 uwsgi 在 Windows 10 編輯 uwsgi 與 nginx 所需的設定檔案, 完成後以 filezilla 送至 Ubuntu. 將 CMSimfly 程式碼送到 Ubuntu 伺服器中對應目錄後. 在 Ubuntu 建立 cmsimfly 服務, 並設定隨機啟動. 完成後, 在 Windows 10 以瀏覽器連線至 CMSimfly, 確認動態網頁與靜態網頁可以在虛擬主機中正常啟動. 以上相關網際內容管理在機械工程相關應用可參考:\xa0 https://www.driveworks.co.uk \xa0或\xa0 https://robotbenchmark.net/ \n 以上資料均可從 https://2019wcm.blogspot.com/ 網際網路內容管理示範網誌找到', 'tags': '', 'url': 'virtualBox.html'}]};